INSERT INTO `wp_tienda_onlinecomments` VALUES (1,1,'Un comentarista de WordPress','wapuu@wordpress.example','https://wordpress.org/','','2025-09-22 01:27:29','2025-09-22 04:27:29','Hola, esto es un comentario.\nPara empezar a moderar, editar y borrar comentarios, por favor, visita en el escritorio la pantalla de comentarios.\nLos avatares de los comentaristas provienen de <a href="https://gravatar.com/">Gravatar</a>.',0,'1','','comment',0,0);
INSERT INTO `wp_tienda_onlinecomments` VALUES (3,985,'A WordPress Commenter','wapuu@wordpress.example','https://wordpress.org/','','2022-04-28 13:45:43','2022-04-28 13:45:43','Hi, this is a comment.\nTo get started with moderating, editing, and deleting comments, please visit the Comments screen in the dashboard.\nCommenter avatars come from <a href="https://gravatar.com" rel="nofollow ugc">Gravatar</a>.',0,'1','','comment',0,0);
