:3:"7.4";s:16:"requires_plugins";a:0:{}s:6:"rating";i:90;s:7:"ratings";a:5:{i:5;i:3808;i:4;i:188;i:3;i:101;i:2;i:109;i:1;i:402;}s:11:"num_ratings";i:4608;s:11:"support_url";s:49:"https://wordpress.org/support/plugin/woocommerce/";s:15:"support_threads";i:579;s:24:"support_threads_resolved";i:481;s:15:"active_installs";i:7000000;s:12:"last_updated";s:22:"2025-09-22 11:13am GMT";s:5:"added";s:10:"2011-09-27";s:8:"homepage";s:24:"https://woocommerce.com/";s:8:"sections";a:6:{s:11:"description";s:13424:"<p><a href="https://woocommerce.com/woocommerce/" rel="nofollow ugc">WooCommerce</a> es la plataforma de comercio electrónico de código abierto para WordPress.</p>\n<p>Nuestra plataforma central es gratuita y flexible, y se ha ampliado gracias a la comunidad global. La libertad que proporciona el código abierto significa que podrás conservar la propiedad completa del contenido y los datos de tu tienda para siempre.</p>\n<p>Tanto si emprendes un negocio como si realizas la actividad comercial en tiendas físicas en línea o desarrollas sitios para clientes, utiliza WooCommerce para que tu tienda pueda aprovechar la combinación de contenido y comercio.</p>\n<ul>\n<li><strong>Crea escaparates bonitos y atractivos</strong> con <a href="https://woocommerce.com/product-category/themes/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">temas</a> apropiados para tu marca y sector.</li>\n<li><strong>Aumenta tus ingresos</strong> con una <a href="https://woocommerce.com/checkout-blocks/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">experiencia de carrito de compra optimizada</a> que convierte.</li>\n<li><strong>Personaliza las páginas de tus productos en cuestión de minutos</strong> mediante los <a href="https://woocommerce.com/document/woocommerce-blocks/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">bloques de producto</a> modulares.</li>\n<li>Muestra productos físicos y digitales, variaciones de productos, configuraciones personalizadas, descargas instantáneas y artículos de afiliados.</li>\n<li>Vende <a href="https://woocommerce.com/products/woocommerce-subscriptions/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">suscripciones</a>, <a href="https://woocommerce.com/products/woocommerce-bookings/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">reservas</a>, o <a href="https://woocommerce.com/products/woocommerce-memberships/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">membresías</a>, con nuestras extensiones validadas por desarrolladores.</li>\n<li><strong>Consigue aparecer en los primeros resultados</strong> gracias a la <a href="https://www.searchenginejournal.com/wordpress-best-cms-seo/" rel="nofollow ugc">ventaja SEO de WordPress</a>.</li>\n<li><strong>Creado en una plataforma que crece.</strong> Consigue un comercio electrónico flexible para <a href="https://woocommerce.com/high-volume-stores/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">tiendas de gran volumen</a>.</li>\n</ul>\n<h4>TODAS LAS HERRAMIENTAS QUE NECESITAS PARA VENDER</h4>\n<p>Las herramientas incorporadas y las integraciones conocidas te ayudarán a gestionar de manera eficiente tus operaciones comerciales. Puedes agregar muchos servicios gratuitamente mediante un solo clic a través del <a href="https://woocommerce.com/document/woocommerce-setup-wizard/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">asistente de configuración</a> opcional.</p>\n<ul>\n<li><strong>Elige cómo quieres que te paguen</strong>. Administra cómodamente los pagos desde la comodidad de su tienda con <a href="https://woocommerce.com/payments/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">WooPayments</a> (Disponible en los EE.UU., Reino Unido, Irlanda, Australia, Nueva Zelanda, Canadá, España, Francia, Alemania e Italia). Acepta de forma segura tarjetas de crédito, billeteras móviles, transferencias bancarias y efectivo gracias a <a href="https://woocommerce.com/product-category/woocommerce-extensions/payment-gateways/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">Más de 100 pasarelas de pago</a> – incluyendo<a href="https://woocommerce.com/products/stripe/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">Stripe</a>, <a href="https://woocommerce.com/products/woocommerce-gateway-paypal-checkout/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">PayPal</a>, y <a href="https://woocommerce.com/products/square/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">Square</a>.</li>\n<li><strong>Configura tus opciones de envío</strong>. Imprime etiquetas de USPS desde tu escritorio e incluso programa recogidas con <a href="https://woocommerce.com/products/shipping/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">WooCommerce Shipping</a> (solo en los EEUU). Conecta con <a href="https://woocommerce.com/product-category/woocommerce-extensions/shipping-methods/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">conocidos transportistas</a> como UPS y FedEx – además de una amplia variedad de soluciones de entrega, inventario y suministro para tu negocio local.</li>\n<li><strong>Simplifica los impuestos de ventas</strong>. Añade <a href="https://woocommerce.com/products/tax/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">WooCommerce Tax</a> o <a href="https://woocommerce.com/product-category/woocommerce-extensions/tax?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">servicios similares integrados</a> para que los cálculos automatizados se conviertan en realidad.</li>\n</ul>\n<h4>Haz crecer tu negocio, añade características, y haz seguimiento de tu tienda sobre la marcha</h4>\n<p>WooCommerce es sinónimo de negocio. Controla las métricas de rendimiento más importantes para ti con un potente y flexible escritorio central integrado en WooCommerce.</p>\n<p>Amplía tu audiencia a través de canales sociales y de marketing con integraciones <a href="https://woocommerce.com/products/google-ads/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">Google Ads</a>, <a href="https://woocommerce.com/products/hubspot-for-woocommerce/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">HubSpot</a>, <a href="https://woocommerce.com/products/mailchimp-for-woocommerce/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">Mailchimp</a>, y <a href="https://woocommerce.com/products/facebook/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">Facebook</a> . Siempre puedes consultar el panel de control <a href="https://woocommerce.com/document/marketing-hub/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">Marketing Hub</a> para obtener nuevas ideas y consejos que te ayudarán a tener éxito.</p>\n<p>Mejora la funcionalidad de la tienda con cientos de extensiones gratis y de pago del <a href="https://woocommerce.com/products/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">mercado oficial de WooCommerce</a>. Nuestros desarrolladores <a href="https://woocommerce.com/document/marketplace-overview/#section-6?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">validan cada nueva extensión</a> y revisan regularmente las extensiones existentes para mantener los estándares de calidad del mercado. Buscamos activamente <a href="https://woocommerce.com/document/marketplace-overview/#section-2?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">productos que ayuden a los creadores de tiendas a crear tiendas con éxito</a>.</p>\n<p>Gestiona tu tienda desde cualquier sitio con la <a href="https://woocommerce.com/mobile/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">aplicación para dispositivos móviles</a> (Android y iOS) de WooCommerce. Alerta de spoiler: intenta obviar el adictivo sonido de notificación cada vez que consigas una nueva venta.</p>\n<h4>Posee y controla los datos de tu tienda – siempre</h4>\n<p>Con <a href="https://woocommerce.com/woocommerce/" rel="nofollow ugc">WooCommerce</a>, tus datos son tuyos. Siempre.</p>\n<p>Si optas por compartir <a href="https://woocommerce.com/usage-tracking/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">datos sobre el uso</a> con nosotros, puedes estar seguro de que seguirán siendo anónimos y estarán protegidos. Puedes desactivar la opción de compartir datos sobre el uso sin que afecte a tu tienda.</p>\n<p>A diferencia de las soluciones de comercio electrónico alojadas, los datos de la tienda WooCommerce están preparados para el futuro; eres libre de exportar todo tu contenido y llevar tu sitio a cualquier plataforma que elijas. Sin restricciones.</p>\n<h4>Por qué los desarrolladores eligen (y les encanta) WooCommerce</h4>\n<p>Los desarrolladores pueden usar <a href="https://woocommerce.com/woocommerce/" rel="nofollow ugc">WooCommerce</a> para crear, personalizar y escalar una tienda para cumplir con las especificaciones exactas de un cliente, y realizar mejoras a través de extensiones o soluciones personalizadas.</p>\n<ul>\n<li>Aprovecha los <a href="https://woocommerce.com/document/introduction-to-hooks-actions-and-filters/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">hooks y filtros</a> para modificar o crear la funcionalidad.</li>\n<li>Integra prácticamente cualquier servicio mediante una <a href="https://developer.woocommerce.com/docs/getting-started-with-the-woocommerce-rest-api/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">API de REST</a> sólida y webhooks.</li>\n<li>Diseña y crea bloques de contenido personalizados con React.</li>\n<li><a href="https://developer.woocommerce.com/docs/category/extension-development/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">Revisa y modifica</a> cualquier aspecto del código del plugin principal.</li>\n<li>Acelera el desarrollo con una <a href="https://developer.woocommerce.com/docs/category/wc-cli/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">CLI</a> ultrarrápida.</li>\n</ul>\n<p>La plataforma central se prueba de forma rigurosa y frecuente con el apoyo de un equipo de desarrollo dedicado que trabaja en distintas zonas horarias. La documentación completa se actualiza con cada versión, lo que te permite crear exactamente la tienda que necesitas.</p>\n<h4>Sé parte de una comunidad internacional creciente</h4>\n<p>WooCommerce tiene una comunidad grande y apasionada dedicada a ayudar a los comerciantes a tener éxito &#8211; y está creciendo rápidamente.</p>\n<p>Hay <a href="https://woocommerce.com/meetups/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">WooCommerce Meetups</a> en lugares de todo el mundo a los que puedes asistir gratis e incluso participar en carreras. Estos eventos son una excelente manera de aprender de otros, compartir la experiencia y conectarse con personas de ideas afines.</p>\n<p>WooCommerce también está presente normalmente en los WordCamps de todo el mundo. Nos encantaría verte allí.</p>\n<h4>Contribuye y traduce</h4>\n<p>WooCommerce está desarrollado y respaldado por Automattic, los creadores de WordPress.com y Jetpack. También tenemos cientos de colaboradores independientes y siempre hay espacio para más. Dirígete al<a href="https://github.com/woocommerce/woocommerce?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">WooCommerce GitHub Repository</a> para descubrir cómo puedes colaborar.</p>\n<p>WooCommerce se ha traducido a varios idiomas, incluidos el danés, el ucraniano y el persa. Ayúdanos a mejorar la traducción de WooCommerce añadiendo tu configuración regional: visita <a href="https://translate.wordpress.org/projects/wp-plugins/woocommerce/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">translate.wordpress.org</a>.</p>\n<h4>Conexión con WooCommerce.com</h4>\n<p>Puedes conectar tu tienda con <a href="https://woocommerce.com/" rel="nofollow ugc">WooCommerce.com</a> para gestionar tus suscripciones en WooCommerce Marketplace y recibir actualizaciones de productos sin salir del administrador de WordPress. La conexión también activa la instalación de los productos comprados desde WooCommerce.com y agiliza el acceso al soporte técnico. Si quieres saber más sobre qué datos se recopilan y cómo se usan, consulta nuestra <a href="https://automattic.com/privacy/" rel="nofollow ugc">política de privacidad</a>.</p>\n";s:12:"installation";s:2823:"<h4>Requisitos mínimos</h4>\n<ul>\n<li>Se necesita la versión PHP 7.4 o superior (se recomienda la versión PHP 8.0 o superior)</li>\n<li>Son obligatorias las versiones de MySQL 5.5.5 o superior, o MariaDB versión 10.1 o superior</li>\n<li>WordPress 6.7 o superior</li>\n<li>(Recomendado) <a href="https://woocommerce.com/document/increasing-the-wordpress-memory-limit/" rel="nofollow ugc">Límite de memoria</a> de WordPress de 256 MB o más.</li>\n<li>(Recomendado) Compatibilidad con <a href="https://woocommerce.com/document/ssl-and-https/" rel="nofollow ugc">HTTPS</a>.</li>\n</ul>\n<h4>Instalación automática</h4>\n<p>La instalación automática es la opción más sencilla, ya que WordPress gestiona las transferencias de archivos y no tendrás que salir de tu navegador web. Para hacer una instalación automática de WooCommerce, accede a tu escritorio de WordPress, ve al menú de plugins y haz clic en «Añadir nuevo».</p>\n<p>En el campo de búsqueda teclea «WooCommerce» y haz clic en «Buscar plugins». Una vez que nos hayas encontrado, puedes ver los detalles, como la versión, la clasificación y la descripción. ¡Lo más importante, por supuesto, es que puedas instalarlo! Haz clic en «Instalar ahora» y WordPress se encargará de ello.</p>\n<h4>Instalación manual</h4>\n<p>El método de instalación manual pasa por descargar el plugin WooCommerce y subirlo a tu servidor mediante tu aplicación FTP favorita. El codex de WordPress tiene <a href="https://wordpress.org/support/article/managing-plugins/#manual-plugin-installation" rel="ugc">instrucciones de cómo se hace</a>.</p>\n<h4>Actualizaciones</h4>\n<p>Las actualizaciones automáticas deberían funcionar sin problemas, pero aún así te recomendamos que hagas una copia de seguridad de tu sitio.</p>\n<p>Si por algún motivo tienes problemas con las páginas de tienda/categoría después de actualizar, solo tienes que forzar los enlaces permanentes yendo a WordPress &gt; Ajustes &gt; Enlaces permanentes y pulsando en «Guardar». Esto debería devolver las cosas a la normalidad.</p>\n<h4>Datos de ejemplo</h4>\n<p>WooCommerce viene con algunos datos de muestra que puedes usar para ver qué aspecto tienen los productos; importa el archivo «sample_products.xml» con el <a href="https://wordpress.org/plugins/wordpress-importer/" rel="ugc">importador de WordPress</a>. También puedes usar el <a href="https://woocommerce.com/document/product-csv-importer-exporter/?utm_source=wp%20org%20repo%20listing&amp;utm_content=3.6" rel="nofollow ugc">importador CSV</a> del núcleo o nuestra <a href="https://woocommerce.com/products/product-csv-import-suite/?utm_source=wp%20org%20repo%20listing&amp;utm_content=3.6" rel="nofollow ugc">extensión de solución completa de importación CSV</a> para importar el archivo «sample_products.csv»</p>\n";s:3:"faq";s:8280:"\n<dt id=\'where%20can%20i%20find%20woocommerce%20documentation%20and%20user%20guides%3F\'>\n¿Dónde puedo encontrar documentación y guías de uso de WooCommerce?\n</h4>\n<p>\n<p>Para obtener ayuda para configurar WooCommerce, consulta la <a href="https://woocommerce.com/documentation/plugins/woocommerce/getting-started/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">guía de inicio</a> y la <a href="https://woocommerce.com/guides/new-store/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">nueva guía para propietarios de la tiendas de WooCommerce</a>.</p>\n<p>Para ampliar o aplicar un tema a WooCommerce, consulta nuestra <a href="https://github.com/woocommerce/woocommerce/tree/trunk/docs" rel="nofollow ugc">documentación</a> y las <a href="https://github.com/woocommerce/woocommerce/blob/trunk/docs/extension-development/extension-development-best-practices.md" rel="nofollow ugc">prácticas recomendadas del desarrollador de plugins</a>.</p>\n</p>\n<dt id=\'where%20can%20i%20get%20help%20or%20talk%20to%20other%20users%20about%20woocommerce%20core%3F\'>\n¿Dónde puedo obtener ayuda o hablar con otros usuarios sobre el núcleo de WooCommerce?\n</h4>\n<p>\n<p>Si continúas teniendo problemas, puedes solicitar ayuda en el <a href="https://wordpress.org/support/plugin/woocommerce/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="ugc">WooCommerce Support Forum</a> siguiendo <a href="https://wordpress.org/support/topic/guide-to-the-woocommerce-forum/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="ugc">estas guías</a>, contacta a <a href="https://woocommerce.com/community-slack/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">WooCommerce Community Slack</a>, o publica un post<a href="https://www.facebook.com/groups/advanced.woocommerce?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">WooCommerce Community group</a> en Facebook.</p>\n</p>\n<dt id=\'where%20can%20i%20get%20help%20for%20extensions%20i%20have%20purchased%20from%20the%20woocommerce%20marketplace%3F\'>\n¿Dónde puedo obtener ayuda para las extensiones que he comprado en WooCommerce Marketplace?\n</h4>\n<p>\n<p>Para obtener ayuda en relación con las extensiones de pago del WooCommerce Marketplace: primero, revisa nuestra <a href="https://woocommerce.com/document/woocommerce-self-service-guide/" rel="nofollow ugc">guía de solución de problemas autoservicio</a> Si el problema continúa, registra un ticket de soporte a través de <a href="https://woocommerce.com/my-account/create-a-ticket/" rel="nofollow ugc"> nuestro servicio de asistencia</a>. Nuestros ingenieros motivados te responderán en un plazo de 24 horas.</p>\n</p>\n<dt id=\'i%E2%80%99m%20having%20trouble%20logging%20in%20to%20woocommerce.com%20%E2%80%93%20what%20now%3F\'>\nEstoy teniendo problemas al acceder a WooCommerce.com &#8211; ¿qué hago?\n</h4>\n<p>\n<p>Primero, soluciona los problemas de inicio de sesión frecuentes mediante está útil <a href="https://woocommerce.com/document/log-into-woocommerce-com-with-wordpress-com/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">step-by-step guide</a>. ¿Sigue sin funcionar? <a href="https://woocommerce.com/contact-us/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">Ponte en contacto con nosotros</a>.</p>\n</p>\n<dt id=\'will%20woocommerce%20work%20with%20my%20theme%3F\'>\n¿Funcionará WooCommerce con mi tema?\n</h4>\n<p>\n<p>Sí. WooCommerce funcionará con cualquier tema, pero es posible que requiera algún estilo adicional. Si buscas un tema que ofrezca una integración profunda con WooCommerce, recomendamos <a href="https://woocommerce.com/storefront/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">Storefront</a>.</p>\n</p>\n<dt id=\'how%20do%20i%20update%20woocommerce%3F\'>\n¿Cómo actualizo WooCommerce?\n</h4>\n<p>\n<p>Disponemos de una guía detallada sobre <a href="https://woocommerce.com/document/how-to-update-woocommerce/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">cómo actualizar WooCommerce</a>.</p>\n</p>\n<dt id=\'my%20site%20broke%20%E2%80%93%20what%20do%20i%20do%3F\'>\nMi sitio está roto &#8211; ¿qué hago?\n</h4>\n<p>\n<p>Primero diagnostica el problema mediante nuestra útil <a href="https://woocommerce.com/documentation/get-help/troubleshooting-get-help/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">guía de solución de problemas</a>.</p>\n<p>Si has detectado el error después de actualizar un tema o plugin, es posible que haya problemas de compatibilidad entre ellos y WooCommerce. Si el problema apareció después de actualizar WooCommerce, es posible que haya un conflicto entre WooCommerce y un tema o plugin obsoletos.</p>\n<p>En ambas instancias, recomendamos realizar una prueba de conflictos mediante <a href="https://woocommerce.com/document/troubleshooting-using-health-check/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">Health Check</a> (que te permite deshabilitar temas y plugins sin que afecte a los visitantes) o aplicar la solución de problemas mediante un <a href="https://woocommerce.com/document/how-to-test-for-conflicts/#section-3?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">sitio de pruebas</a>.</p>\n</p>\n<dt id=\'where%20can%20i%20report%20bugs%3F\'>\n¿Dónde puedo reportar errores?\n</h4>\n<p>\n<p>Informa de los errores en el <a href="https://github.com/woocommerce/woocommerce/issues?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">repositorio de GitHub de WooCommerce</a>. También puedes informarnos a través del foro de soporte. Busca el error en los foros para asegurarte de que no se haya informado ya de él.</p>\n</p>\n<dt id=\'where%20can%20i%20request%20new%20features%2C%20themes%2C%20and%20extensions%3F\'>\n¿Dónde puedo solicitar nuevas características, temas y extensiones?\n</h4>\n<p>\n<p>Solicita nuevas funciones y extensiones, y vota las sugerencias existentes en nuestro <a href="https://woocommerce.com/feature-requests/woocommerce?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">panel de ideas</a> oficial. Nuestros equipos de productos revisan regularmente las solicitudes y las tienen en cuenta en la planificación de los productos.</p>\n</p>\n<dt id=\'woocommerce%20is%20awesome%21%20can%20i%20contribute%3F\'>\n¡WooCommerce es alucinante! ¿Puedo contribuir?\n</h4>\n<p>\n<p>¡Sí, puedes! Únete a nuestro <a href="https://github.com/woocommerce/woocommerce/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">repositorio en GitHub</a> y sigue el <a href="https://woocommerce.wordpress.com/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">blog de desarrollo</a> para estar al día de todo lo que pasa en el proyecto.</p>\n</p>\n<dt id=\'where%20can%20i%20find%20rest%20api%20documentation%3F\'>\n¿Dónde puedo encontrar la documentación de la API REST?\n</h4>\n<p>\n<p>Amplia <a href="https://woocommerce.github.io/woocommerce-rest-api-docs/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">documentación sobre la API REST de WooCommerce</a> disponible en GitHub.</p>\n</p>\n<dt id=\'my%20question%20is%20not%20listed%20here.%20where%20can%20i%20find%20more%20answers%3F\'>\nMi pregunta no está en esta lista. ¿Dónde puedo encontrar más respuestas?\n</h4>\n<p>\n<p>Revisa las <a href="https://woocommerce.com/document/frequently-asked-questions/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">preguntas frecuentes</a> para más información.</p>\n</p>\n\n";s:9:"changelog";s:1557:"<h4>10.2.1 2025-09-22</h4>\n<p><strong>WooCommerce</strong></p>\n<ul>\n<li>Correción &#8211; Problema de script de actualización de dirección en el que el pedido de $ reembolsado puede no existir, y deshabilitar la herramienta de pedidos reembolsados. <a href="https://github.com/woocommerce/woocommerce/pull/61022" rel="nofollow ugc">#61022</a></li>\n<li>Correción &#8211; Degrada la dependencia de Emogrifier para evitar conflictos <a href="https://github.com/woocommerce/woocommerce/pull/60997" rel="nofollow ugc">#60997</a></li>\n<li>Correción &#8211; Arregla la visualización del precio del producto en los idiomas RTL <a href="https://github.com/woocommerce/woocommerce/pull/61000" rel="nofollow ugc">#61000</a></li>\n<li>Actualización &#8211; Mejora del reconocimiento de slug de plantilla en el mecanismo de registro de bloques de productos. Garantiza la compatibilidad con WordPress 6.9 <a href="https://github.com/woocommerce/woocommerce/pull/61009" rel="nofollow ugc">#61009</a></li>\n<li>Desarrollo &#8211; Reemplaza los métodos de núcleo/edición obsoletos con métodos de núcleo/editor <a href="https://github.com/woocommerce/woocommerce/pull/61009" rel="nofollow ugc">#61009</a></li>\n<li>Desarrollo &#8211; Deja de confiar en métodos de núcleo/edición obsoletos <a href="https://github.com/woocommerce/woocommerce/pull/61009" rel="nofollow ugc">#61009</a></li>\n</ul>\n<p><a href="https://raw.githubusercontent.com/woocommerce/woocommerce/trunk/changelog.txt" rel="nofollow ugc">Ver registro de cambios para todas las versiones.</a>.</p>\n";s:11:"screenshots";s:1035:"<ol><li><a href="https://ps.w.org/woocommerce/assets/screenshot-1.png?rev=3234504"><img src="https://ps.w.org/woocommerce/assets/screenshot-1.png?rev=3234504" alt=""></a></li><li><a href="https://ps.w.org/woocommerce/assets/screenshot-2.png?rev=3234504"><img src="https://ps.w.org/woocommerce/assets/screenshot-2.png?rev=3234504" alt=""></a></li><li><a href="https://ps.w.org/woocommerce/assets/screenshot-3.png?rev=3234504"><img src="https://ps.w.org/woocommerce/assets/screenshot-3.png?rev=3234504" alt=""></a></li><li><a href="https://ps.w.org/woocommerce/assets/screenshot-4.png?rev=3235205"><img src="https://ps.w.org/woocommerce/assets/screenshot-4.png?rev=3235205" alt=""></a></li><li><a href="https://ps.w.org/woocommerce/assets/screenshot-5.png?rev=3234504"><img src="https://ps.w.org/woocommerce/assets/screenshot-5.png?rev=3234504" alt=""></a></li><li><a href="https://ps.w.org/woocommerce/assets/screenshot-6.png?rev=3234504"><img src="https://ps.w.org/woocommerce/assets/screenshot-6.png?rev=3234504" alt=""></a></li></ol>";s:7:"reviews";s:16679:"<div class="review">\n	<div class="review-head">\n		<div class="reviewer-info">\n			<div class="review-title-section">\n				<h4 class="review-title">Calm professional advice</h4>\n				<div class="star-rating">\n				<div class="wporg-ratings" aria-label="5 de 5 estrellas" data-title-template="%s de 5 estrellas" data-rating="5" style="color:#ffb900;"><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span></div>				</div>\n			</div>\n			<p class="reviewer">\n				Por <a href="https://profiles.wordpress.org/amyskea/"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/8e30b40585d2ba96eb5bb2d9763c9c19caf9bad8d5a9bff160eebbc4dc65eeea?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/8e30b40585d2ba96eb5bb2d9763c9c19caf9bad8d5a9bff160eebbc4dc65eeea?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href="https://profiles.wordpress.org/amyskea/" class="reviewer-name">amyskea</a> en <span class="review-date">Septiembre 25, 2025</span>			</p>\n		</div>\n	</div>\n	<div class="review-body"><!-- wp:paragraph -->\n<p>The payment page on the admin side of our web was completely blank and my site wasn\'t taking credit card payments.  Cool calm professional advice was given very quickly. <br /><br />We have had Woo Commerce for over 5 years with no problems and so it was good to know that when we did have a technical problem that the support was there to get us back up and running quickly.<br /><br />Thank you </p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class="review">\n	<div class="review-head">\n		<div class="reviewer-info">\n			<div class="review-title-section">\n				<h4 class="review-title">Fast and useful support</h4>\n				<div class="star-rating">\n				<div class="wporg-ratings" aria-label="5 de 5 estrellas" data-title-template="%s de 5 estrellas" data-rating="5" style="color:#ffb900;"><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span></div>				</div>\n			</div>\n			<p class="reviewer">\n				Por <a href="https://profiles.wordpress.org/certusmercatus/"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/2e1fb055f37812aa8fc37ae7dc4a3a5deb899da3c1d53499824d0b1aa43f8cf4?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/2e1fb055f37812aa8fc37ae7dc4a3a5deb899da3c1d53499824d0b1aa43f8cf4?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href="https://profiles.wordpress.org/certusmercatus/" class="reviewer-name">certusmercatus</a> en <span class="review-date">Septiembre 23, 2025</span>			</p>\n		</div>\n	</div>\n	<div class="review-body"><!-- wp:paragraph -->\n<p>Thank you for the fast and helpful support, you quickly and effectively directed me on the right path to recovery.</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class="review">\n	<div class="review-head">\n		<div class="reviewer-info">\n			<div class="review-title-section">\n				<h4 class="review-title">Great plugin for eCommerce</h4>\n				<div class="star-rating">\n				<div class="wporg-ratings" aria-label="5 de 5 estrellas" data-title-template="%s de 5 estrellas" data-rating="5" style="color:#ffb900;"><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span></div>				</div>\n			</div>\n			<p class="reviewer">\n				Por <a href="https://profiles.wordpress.org/basz85/"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/80e43d390f8ff113a4cd518bc7a673a3b1a651b37f5a82d4fcc35fb71b205b7c?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/80e43d390f8ff113a4cd518bc7a673a3b1a651b37f5a82d4fcc35fb71b205b7c?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href="https://profiles.wordpress.org/basz85/" class="reviewer-name">Bas <small>(Basz85)</small></a> en <span class="review-date">Septiembre 22, 2025</span>			</p>\n		</div>\n	</div>\n	<div class="review-body"><!-- wp:paragraph -->\n<p>It\'s a great plugin for selling products for a webshop. Many features to make it happen, and their also (premium) plugin add-ons to make the WooCommerce plugin better and more flexible for your standards and wishes or for your client\'s wishes. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The only thing if you started it\'s kinda learning curve how everything works and the Shipping Zones and Shipping Rates can be challening to set it up (in the older versions it was easy in my opinion, but in the new versions it\'s more flexible and advanced, so more learning curve).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Overall I give the plugin a 5 star rating. It\'s a great and awesome plugin. Give yourself time and be patient, if you use it for the first time. And you can always drop here an Support Topic at their Support forums of WooCommerce :). </p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class="review">\n	<div class="review-head">\n		<div class="reviewer-info">\n			<div class="review-title-section">\n				<h4 class="review-title">Fantastic</h4>\n				<div class="star-rating">\n				<div class="wporg-ratings" aria-label="5 de 5 estrellas" data-title-template="%s de 5 estrellas" data-rating="5" style="color:#ffb900;"><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span></div>				</div>\n			</div>\n			<p class="reviewer">\n				Por <a href="https://profiles.wordpress.org/leedskoi/"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/919ddf399ea0344cb44213170b255a3256992df315bd7b444ea9705cba29e36e?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/919ddf399ea0344cb44213170b255a3256992df315bd7b444ea9705cba29e36e?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href="https://profiles.wordpress.org/leedskoi/" class="reviewer-name">leedskoi</a> en <span class="review-date">Septiembre 21, 2025</span>			</p>\n		</div>\n	</div>\n	<div class="review-body"><!-- wp:paragraph -->\n<p>absolutely fantastic support I received with sorting what I thought was a bug in WooCommerce but it wasn\'t I had to install another plugging to complement WooCommerce which they both work in harmony and site back up and running thanks 👍</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class="review">\n	<div class="review-head">\n		<div class="reviewer-info">\n			<div class="review-title-section">\n				<h4 class="review-title">How To Edit Checkout Requirements.</h4>\n				<div class="star-rating">\n				<div class="wporg-ratings" aria-label="5 de 5 estrellas" data-title-template="%s de 5 estrellas" data-rating="5" style="color:#ffb900;"><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span></div>				</div>\n			</div>\n			<p class="reviewer">\n				Por <a href="https://profiles.wordpress.org/adrian33000/"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/c9566b76f55305891d88e99e20a89bf5c129eb46b9c6ec95fcf7c424a114286d?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/c9566b76f55305891d88e99e20a89bf5c129eb46b9c6ec95fcf7c424a114286d?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href="https://profiles.wordpress.org/adrian33000/" class="reviewer-name">adrian33000</a> en <span class="review-date">Septiembre 21, 2025</span>			</p>\n		</div>\n	</div>\n	<div class="review-body"><!-- wp:paragraph -->\n<p>After some false starts, due to my supplying incorrect shortcode information, I was provided with some links to WooCommerce docs that provided the answer to my question and avoided the need to pay for a plugin to do the job.  So very pleased with the assistance I received</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class="review">\n	<div class="review-head">\n		<div class="reviewer-info">\n			<div class="review-title-section">\n				<h4 class="review-title">Great Plug-in and Great Community</h4>\n				<div class="star-rating">\n				<div class="wporg-ratings" aria-label="5 de 5 estrellas" data-title-template="%s de 5 estrellas" data-rating="5" style="color:#ffb900;"><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span></div>				</div>\n			</div>\n			<p class="reviewer">\n				Por <a href="https://profiles.wordpress.org/juliandawn/"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/803644a966adcdff852b8763ecbf089c9931c8a1fe56b889b8bd40b863711421?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/803644a966adcdff852b8763ecbf089c9931c8a1fe56b889b8bd40b863711421?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href="https://profiles.wordpress.org/juliandawn/" class="reviewer-name">juliandawn</a> en <span class="review-date">Septiembre 18, 2025</span>			</p>\n		</div>\n	</div>\n	<div class="review-body"><!-- wp:paragraph -->\n<p>I recently encountered some problem regarding importing products information and I asked for help in the forum. Got very quick response from experts, credits to shahzeen(woo-hc) (@shahzeenfarooq). Very professional response and helped me locate the problem quickly.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Love the vibe here, great support, friendly people, helpful experts and full of love.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Thanks</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class="review">\n	<div class="review-head">\n		<div class="reviewer-info">\n			<div class="review-title-section">\n				<h4 class="review-title">Disble Local pickup for countries</h4>\n				<div class="star-rating">\n				<div class="wporg-ratings" aria-label="5 de 5 estrellas" data-title-template="%s de 5 estrellas" data-rating="5" style="color:#ffb900;"><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span></div>				</div>\n			</div>\n			<p class="reviewer">\n				Por <a href="https://profiles.wordpress.org/polug/"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/67264fdfffc59f3ed886420875b106bf32d5742cf6895355aa690bb7fe9cf612?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/67264fdfffc59f3ed886420875b106bf32d5742cf6895355aa690bb7fe9cf612?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href="https://profiles.wordpress.org/polug/" class="reviewer-name">polug</a> en <span class="review-date">Septiembre 17, 2025</span>			</p>\n		</div>\n	</div>\n	<div class="review-body"><!-- wp:paragraph -->\n<p>Great support, not the solution i expected. </p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class="review">\n	<div class="review-head">\n		<div class="reviewer-info">\n			<div class="review-title-section">\n				<h4 class="review-title">Responsive support</h4>\n				<div class="star-rating">\n				<div class="wporg-ratings" aria-label="5 de 5 estrellas" data-title-template="%s de 5 estrellas" data-rating="5" style="color:#ffb900;"><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span></div>				</div>\n			</div>\n			<p class="reviewer">\n				Por <a href="https://profiles.wordpress.org/nascas/"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/a97e67f1197de7dfb3a84b201df73ecad5d1e954af6aece4854e55352f57c9a8?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/a97e67f1197de7dfb3a84b201df73ecad5d1e954af6aece4854e55352f57c9a8?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href="https://profiles.wordpress.org/nascas/" class="reviewer-name">Rico <small>(nascas)</small></a> en <span class="review-date">Septiembre 16, 2025</span>			</p>\n		</div>\n	</div>\n	<div class="review-body"><!-- wp:paragraph -->\n<p>They are incredibly fast! ;)<br />The WC itself is alright, I\'m not a fan of the new analyitcs but there\'s always room for improvement ;)</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class="review">\n	<div class="review-head">\n		<div class="reviewer-info">\n			<div class="review-title-section">\n				<h4 class="review-title">Thank you</h4>\n				<div class="star-rating">\n				<div class="wporg-ratings" aria-label="5 de 5 estrellas" data-title-template="%s de 5 estrellas" data-rating="5" style="color:#ffb900;"><span class