INSERT INTO `wp_tienda_onlineoptions` VALUES (697,'_elementor_notifications_data','a:2:{s:7:"timeout";i:1758600724;s:5:"value";s:18404:"[{"id":"variables-3.31","title":"Scalable design with Variables","description":"Define once, reuse everywhere. Color & Font Variables help you build consistent, scalable design systems that update globally and are perfect for large sites or teams.","topic":"Editor V4 Alpha","imageSrc":"https:\\/\\/assets.elementor.com\\/notifications\\/v1\\/images\\/3.31-variables.png","chipTags":["New Feature"],"link":"https:\\/\\/go.elementor.com\\/go-pro-notification-3.31-v4-blog\\/","readMoreText":"Learn More"},{"id":"host-special-offer","title":"Host with Elementor, Get Unified Support for Building & Hosting","description":"Advance to Elementor\'s Cloud Hosting powered by Google Cloud and Cloudflare. Use the coupon CLOUDPLUSSPECIAL2025 to get Host Cloud Plus at the price of Host Cloud.","topic":"Special offer: Elementor Host","imageSrc":"https:\\/\\/assets.elementor.com\\/notifications\\/v1\\/images\\/host_coupon.png","chipTags":["Cloud Hosting"],"cta":"Get it Now","ctaLink":"https:\\/\\/go.elementor.com\\/host-whats-new-host-discount\\/"},{"id":"filters-3.31","title":"Visual effects with Filters and Backdrop Filters","description":"Apply multiple Filters like blur, brightness, and contrast. Stack, reorder, and preview in real time without writing a line of code.","topic":"Editor V4 Alpha","imageSrc":"https:\\/\\/assets.elementor.com\\/notifications\\/v1\\/images\\/3.31-filters.png","chipTags":["New Feature"],"link":"https:\\/\\/go.elementor.com\\/go-pro-notification-3.31-v4-blog\\/","readMoreText":"Learn More"},{"id":"ally-assistant","title":"New! Fix accessibility issues with Ally Assistant","description":"Scan any page for accessibility issues and fix them in one click. From color contrast to missing alt text, Ally Assistant provides guided steps or AI-powered fixes to make your site more inclusive.","topic":"Ally by Elementor","imageSrc":"https:\\/\\/assets.elementor.com\\/notifications\\/v1\\/images\\/ally-assistant.png","chipTags":["New Feature"],"cta":"Scan for free","ctaLink":"http:\\/\\/go.elementor.com\\/acc-assistant-launch-whats-new","conditions":[[{"type":"plugin","operator":"!=","plugin":"pojo-accessibility\\/pojo-accessibility.php"}]]},{"id":"classes-3.31","title":"Smarter Class Manager tools","description":"Quickly locate and manage Global Classes with usage counts, a new locator panel, and full class search. Perfect for scaling and refactoring complex design systems.","topic":"Editor V4 Alpha","imageSrc":"https:\\/\\/assets.elementor.com\\/notifications\\/v1\\/images\\/3.31-classes.png","chipTags":["New Feature"],"link":"https:\\/\\/go.elementor.com\\/go-pro-notification-3.31-v4-blog\\/","readMoreText":"Learn More"},{"id":"send-notification-august","title":"All Your Assets, One Library","description":"Save time and skip the re-uploads - now you can pull images straight from your WordPress Media Library into Send. Faster, simpler, and built for WordPress.","topic":"Send: Email & SMS built for WooCommerce","imageSrc":"https:\\/\\/assets.elementor.com\\/notifications\\/v1\\/images\\/aug_send.png","chipTags":["Cart abandonment"],"cta":"Upload Your Assets","ctaLink":"https:\\/\\/go.elementor.com\\/ML_WN","conditions":[[{"type":"plugin","operator":"!=","plugin":"send-app\\/send-app.php"}]]},{"id":"attributes-3.31","title":"Add semantic HTML with Attributes","description":"Add custom HTML attributes like aria-*, data-*, and role to any element. Structure your markup for better accessibility, performance, and compliance.","topic":"Elementor Pro 3.31","imageSrc":"https:\\/\\/assets.elementor.com\\/notifications\\/v1\\/images\\/3.31-attributes.png","chipPlan":"Pro","chipTags":["New Feature"],"link":"https:\\/\\/go.elementor.com\\/go-pro-notification-3.31-v4-blog\\/","readMoreText":"Learn More","conditions":[[{"type":"plugin","plugin":"elementor-pro\\/elementor-pro.php"}]]},{"id":"attributes-3.31","title":"Add semantic HTML with Attributes","description":"Add custom HTML attributes like aria-*, data-*, and role to any element. Structure your markup for better accessibility, performance, and compliance.","topic":"Elementor Pro 3.31","imageSrc":"https:\\/\\/assets.elementor.com\\/notifications\\/v1\\/images\\/3.31-attributes.png","chipTags":["New Feature"],"cta":"Upgrade now","ctaLink":"https:\\/\\/go.elementor.com\\/go-pro-notification-3.31-attributes\\/"},{"id":"classes-3.30","title":"Better class control","description":"Get popovers with your class name, breakpoint, state and possible conflicts. Plus, the exact class names you define are now reflected in the code, making debugging and working with external tools easier!","topic":"Editor V4 Alpha","imageSrc":"https:\\/\\/assets.elementor.com\\/notifications\\/v1\\/images\\/classes-3.30.png","chipTags":["New Feature"],"link":"https:\\/\\/go.elementor.com\\/go-pro-notification-3.39-v4-blog\\/","readMoreText":"Learn More"},{"id":"cloud-websites-3.30","title":"Full Website Templates in the cloud","description":"Save and apply entire websites, including multiple pages, styles, site settings, media, and layout configurations - directly from the cloud.","topic":"Elementor Pro 3.30","imageSrc":"https:\\/\\/assets.elementor.com\\/notifications\\/v1\\/images\\/cloud-3.30.png","chipPlan":"Pro","chipTags":["New Feature"],"link":"https:\\/\\/go.elementor.com\\/go-pro-notification-3.39-v4-blog\\/","readMoreText":"Learn More","conditions":[[{"type":"plugin","plugin":"elementor-pro\\/elementor-pro.php"}]]},{"id":"cloud-websites-3.30","title":"Full Website Templates in the cloud","description":"Save and apply entire websites, including multiple pages, styles, site settings, media, and layout configurations - directly from the cloud.","topic":"Elementor Pro 3.30","imageSrc":"https:\\/\\/assets.elementor.com\\/notifications\\/v1\\/images\\/cloud-3.30.png","chipTags":["New Feature"],"cta":"Upgrade now","ctaLink":"https:\\/\\/go.elementor.com\\/go-pro-notification-3.30-cloud-websites\\/"},{"id":"tools-3.30","title":"Essential Editor tools","description":"V4 now includes a long list of essential V3 capabilities, re-engineered to fit the new framework - IDs, custom unit, anchor offset, display none, object fit, clear icons and more!","topic":"Editor V4 Alpha","imageSrc":"https:\\/\\/assets.elementor.com\\/notifications\\/v1\\/images\\/tools-3.30.png","chipTags":["New Feature"],"link":"https:\\/\\/go.elementor.com\\/go-pro-notification-3.39-v4-blog\\/","readMoreText":"Learn More"},{"id":"youtube-3.30","title":"YouTube Element","description":"The new YouTube Element is purpose-built to support V4 capabilities with faster rendering, better performance, and familiar controls like autoplay, loop, mute, and aspect ratio.","topic":"Editor V4 Alpha","imageSrc":"https:\\/\\/assets.elementor.com\\/notifications\\/v1\\/images\\/youtube-3.30.png","chipTags":["New Feature"],"link":"https:\\/\\/go.elementor.com\\/go-pro-notification-3.39-v4-blog\\/","readMoreText":"Learn More"},{"id":"host-google-cloud","title":"Deliver fast, secure websites at scale - free migration included!","description":"Host your site on Elementor\\u2019s infrastructure - built for speed, security, and scale. Powered by Google Cloud, with free migration and 24\\/7 expert support.","topic":"Host","imageSrc":"https:\\/\\/assets.elementor.com\\/notifications\\/v1\\/images\\/host-google-cloud.png","chipTags":["Cloud Hosting"],"link":"https:\\/\\/go.elementor.com\\/elementor-host-google-cloud","readMoreText":"Read More"},{"id":"cloud-templates-3.29","title":"Your Templates, available everywhere","description":"Store sections, containers, and full pages in the cloud\\u2014making them accessible across all your Pro-connected sites. Style once, reuse anywhere!","topic":"Elementor Pro 3.29","imageSrc":"https:\\/\\/assets.elementor.com\\/notifications\\/v1\\/images\\/cloud-templates.png","chipPlan":"Pro","chipTags":["New Feature"],"link":"https